import React, { Component } from 'react'

class TodoItems extends Component {
    createTasks(item) {
        return <li key={item.key}>{item.text}</li>
    }
    render() {
        const todoEntries = this.props.entries
        const listItems = todoEntries && todoEntries.length > 0 ? todoEntries.map(this.createTasks) : []
        const listItemsLi =  listItems.map(item, it => {
            return <li key={it}>item</li>
        })
        const list =
            <div>
                <ul className="theList">
                {listItemsLi}
                </ul>
            </div>

        return list;

    }
}
export default TodoItems
